import logements from '../../assets/data/logements.json'

function Card() {
     return (
          <div>
               <ul>
                    {logements.map((logement) => (
                         <li className="card" key={logement.id}>
                              <img className='card-image' src={logement.cover} alt={logement.title} />
                              <h2>  {logement.title}</h2>
                         </li>
                    ))}
               </ul>
          </div>
     )
}

export default Card
